(12, 'Control-M 7 Settings', 6, 6, 6, '<p>Procedure describes steps to be taken in order to setup Control-M version 7</p>\r\n', '', '', '<p>Using new Control-M You will need to configure it again for first time, here are required options:</p>\r\n\r\n<p><br />\r\n1</p>\r\n\r\n<p>2</p>\r\n\r\n<p>3</p>\r\n\r\n<p>4</p>\r\n\r\n<p>5</p>\r\n\r\n<p>6</p>\r\n\r\n<p>7</p>\r\n\r\n<p><br />\r\n********************************************************************************************</p>\r\n\r\n<p><br />\r\nFor Global Alert Server please use filters for proper information display:</p>\r\n\r\n<p><br />\r\n1) Set &quot;Status&quot; -&gt; &quot;Not Noticed&quot;</p>\r\n\r\n<p>2) Edit filter (bottom right corner)</p>\r\n\r\n<p>3) Add new &ldquo;And&rdquo; condition</p>\r\n\r\n<p>4) Set it to &ldquo;Message&rdquo;</p>\r\n\r\n<p>5) Set rule to &ldquo;Does not contain&rdquo;</p>\r\n\r\n<p>6) Enter value &ldquo;STATUS OF AGENT PLATFORM&rdquo;</p>\r\n\r\n<p>7) Repeat steps 3-&gt;6 with new value &ldquo;FAILED TO DELETE CONDITION&rdquo;</p>\r\n\r\n<p>8) Press OK</p>\r\n\r\n<p>9) Choose View -&gt; Colour Scheme -&gt; Old Scheme</p>\r\n', '', '', 1, 1, '2016-07-14 09:51:02', 'admin', '2016-07-14 09:51:02', 'admin'),
(13, '  Very Fresh Procedure V3', 5, 2, 2, '<p>This is very fresh procedure! Trust me on this one!</p>\r\n', '<p>Depends on strenght of your force!</p>\r\n', '<p>Clear Your mind! Access your inner streght!</p>\r\n', '<p>Use the force, Luke!!!!</p>\r\n', '<p>Try harder U tryhard..</p>\r\n\r\n<p>Do or do not - there is no try!</p>\r\n', '<p>Well, its gonna be a bad day for You kid! Sucks to be You..</p>\r\n\r\n<p>KeK</p>\r\n', 1, 3, '2016-07-14 09:51:02', 'admin', '2016-07-15 11:20:40', 'admin'),
